Rembrandt: null
? "Rembrandt Since the discovery of this painting in the early twentieth century there
  has been a discussion about its attribution. Rosenberg rejected an attribution to
  Rembrandt, regarding it as an old copy after Rembrandt (Rosenberg 1956, no. 354).
  Bauch proposed an attribution to Gerrit Dou (Bauch 1960, p. 228-229; Bauch 1966,
  p. 48). In 1982 the RRP listed the painting in the B-category of the Corpus with
  paintings of which an attribution to Rembrandt cannot be accepted nor rejected (Corpus
  of Rembrandt Paintings 1982-2015, vol. 1 (1982), no. B 2). T\xC3\xBCmpel regarded
  it as a work by an early follower of Rembrandt (T\xC3\xBCmpel 1986, no. A 28). Since
  the restoration of the painting in 1994, removing the eighteenth century additions
  and overpainting, most art historians agree on an attribution to Rembrandt (see
  for instance: Van Straten/Moerman 2005, p. 30; Weller et al. 2011, no. 2; Corpus
  of Rembrandt Paintings 1982-2015, vol. 6 (2015), no. 3)."
